PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "migrations" ("id" integer primary key autoincrement not null, "migration" varchar not null, "batch" integer not null);
CREATE TABLE IF NOT EXISTS "cache" ("key" varchar not null, "value" text not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "cache_locks" ("key" varchar not null, "owner" varchar not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "jobs" ("id" integer primary key autoincrement not null, "queue" varchar not null, "payload" text not null, "attempts" integer not null, "reserved_at" integer, "available_at" integer not null, "created_at" integer not null);
CREATE TABLE IF NOT EXISTS "job_batches" ("id" varchar not null, "name" varchar not null, "total_jobs" integer not null, "pending_jobs" integer not null, "failed_jobs" integer not null, "failed_job_ids" text not null, "options" text, "cancelled_at" integer, "created_at" integer not null, "finished_at" integer, primary key ("id"));
CREATE TABLE IF NOT EXISTS "failed_jobs" ("id" integer primary key autoincrement not null, "uuid" varchar not null, "connection" text not null, "queue" text not null, "payload" text not null, "exception" text not null, "failed_at" datetime not null default CURRENT_TIMESTAMP);
CREATE TABLE IF NOT EXISTS "personal_access_tokens" ("id" integer primary key autoincrement not null, "tokenable_type" varchar not null, "tokenable_id" integer not null, "name" varchar not null, "token" varchar not null, "abilities" text, "last_used_at" datetime, "expires_at" datetime, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "sessions" ("id" varchar not null, "user_id" integer, "ip_address" varchar, "user_agent" text, "payload" text not null, "last_activity" integer not null, primary key ("id"));
CREATE TABLE IF NOT EXISTS "companies" ("id" integer primary key autoincrement not null, "name" varchar not null, "rut" varchar not null, "address" varchar not null, "city" varchar not null, "phone" varchar not null, "email" varchar not null, "contact_person" varchar not null, "contact_phone" varchar not null, "contact_email" varchar not null, "is_active" tinyint(1) not null default '1', "notes" text, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "customs_declarations" ("id" integer primary key autoincrement not null, "company_id" integer not null, "user_id" integer not null, "declaration_number" varchar not null, "document_type" varchar not null, "status" varchar not null default 'draft', "declaration_date" date not null, "customs_office" varchar not null, "transport_mode" varchar not null, "container_number" varchar, "bill_of_lading" varchar, "total_value" numeric not null, "total_weight" numeric not null, "description" text not null, "hermes_message" text, "hermes_response" text, "sent_to_hermes_at" datetime, "hermes_processed_at" datetime, "notes" text, "created_at" datetime, "updated_at" datetime, foreign key("company_id") references "companies"("id") on delete cascade, foreign key("user_id") references "users"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "merchandise" ("id" integer primary key autoincrement not null, "customs_declaration_id" integer not null, "item_number" varchar not null, "description" varchar not null, "hs_code" varchar not null, "origin_country" varchar not null, "quantity" numeric not null, "unit_of_measure" varchar not null, "unit_value" numeric not null, "total_value" numeric not null, "weight" numeric not null, "brand" varchar, "model" varchar, "additional_info" text, "created_at" datetime, "updated_at" datetime, foreign key("customs_declaration_id") references "customs_declarations"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "api_logs" ("id" integer primary key autoincrement not null, "customs_declaration_id" integer, "endpoint" varchar not null, "method" varchar not null, "request_data" text, "response_data" text, "response_code" integer, "status" varchar not null, "error_message" text, "sent_at" datetime not null, "received_at" datetime, "response_time_ms" integer, "created_at" datetime, "updated_at" datetime, foreign key("customs_declaration_id") references "customs_declarations"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "tickets" ("id" integer primary key autoincrement not null, "titulo" varchar not null, "descripcion" text not null, "estado" varchar check ("estado" in ('nuevo', 'en_proceso', 'cerrado')) not null default 'nuevo', "user_id" integer not null, "asignado_a" integer, "created_at" datetime, "updated_at" datetime, foreign key("user_id") references "users"("id") on delete cascade, foreign key("asignado_a") references "users"("id") on delete set null);
CREATE TABLE IF NOT EXISTS "permissions" ("id" integer primary key autoincrement not null, "name" varchar not null, "guard_name" varchar not null, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "roles" ("id" integer primary key autoincrement not null, "name" varchar not null, "guard_name" varchar not null, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "model_has_permissions" ("permission_id" integer not null, "model_type" varchar not null, "model_id" integer not null, foreign key("permission_id") references "permissions"("id") on delete cascade, primary key ("permission_id", "model_id", "model_type"));
CREATE TABLE IF NOT EXISTS "model_has_roles" ("role_id" integer not null, "model_type" varchar not null, "model_id" integer not null, foreign key("role_id") references "roles"("id") on delete cascade, primary key ("role_id", "model_id", "model_type"));
CREATE TABLE IF NOT EXISTS "role_has_permissions" ("permission_id" integer not null, "role_id" integer not null, foreign key("permission_id") references "permissions"("id") on delete cascade, foreign key("role_id") references "roles"("id") on delete cascade, primary key ("permission_id", "role_id"));
CREATE TABLE IF NOT EXISTS "operadors" ("id" integer primary key autoincrement not null, "codigo" varchar not null, "rut_operador" varchar not null, "nombre_operador" varchar not null, "nombre_fantasia" varchar, "direccion_operador" varchar, "resolucion_operador" varchar, "logo_operador" varchar, "firma_operador" varchar, "rut_representante" varchar, "nombre_representante" varchar, "cargo_representante" varchar, "estado" varchar check ("estado" in ('Activo', 'Inactivo')) not null default 'Activo', "fecha_creacion" date, "fecha_actualizacion" datetime, "usuario_id" integer, "nombre_remitente" varchar, "email_remitente" varchar, "email_copia" varchar, "valida_ingreso_aduana" tinyint(1) not null default '0', "email_notificaciones" varchar, "created_at" datetime, "updated_at" datetime, foreign key("usuario_id") references "users"("id") on delete set null);
CREATE TABLE IF NOT EXISTS "empresa_transportistas" ("id" integer primary key autoincrement not null, "nombre_empresa" varchar not null, "rut_empresa" varchar not null, "direccion" varchar, "ciudad" varchar, "telefono" varchar, "email" varchar, "contacto_persona" varchar, "contacto_telefono" varchar, "contacto_email" varchar, "estado" varchar check ("estado" in ('Activo', 'Inactivo')) not null default 'Activo', "observaciones" text, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "aduana_chiles" ("id" integer primary key autoincrement not null, "codigo" varchar not null, "nombre_aduana" varchar not null, "ubicacion" varchar, "region" varchar, "direccion" varchar, "telefono" varchar, "email" varchar, "estado" varchar check ("estado" in ('Activo', 'Inactivo')) not null default 'Activo', "observaciones" text, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "lugar_depositos" ("id" integer primary key autoincrement not null, "codigo" varchar not null, "nombre_deposito" varchar not null, "direccion" varchar, "ciudad" varchar, "region" varchar, "capacidad" varchar, "telefono" varchar, "email" varchar, "operador_id" integer, "estado" varchar check ("estado" in ('Activo', 'Inactivo')) not null default 'Activo', "observaciones" text, "created_at" datetime, "updated_at" datetime, foreign key("operador_id") references "operadors"("id") on delete set null);
CREATE TABLE IF NOT EXISTS "users" ("id" integer primary key autoincrement not null, "name" varchar not null, "email" varchar not null, "email_verified_at" datetime, "phone" varchar, "location" varchar, "about" text, "password" varchar not null, "remember_token" varchar, "created_at" datetime, "updated_at" datetime, "operador_id" integer, "fotografia" varchar, "rut_usuario" varchar, "estado" varchar check ("estado" in ('Activo', 'Inactivo')) not null default 'Activo', "ultimo_movimiento" datetime, "fecha_renovacion_password" datetime, "cambio_password_requerido" tinyint(1) not null default '0', foreign key("operador_id") references "operadors"("id") on delete set null);
CREATE TABLE IF NOT EXISTS "tipo_contenedors" ("id" integer primary key autoincrement not null, "codigo" varchar not null, "descripcion" varchar not null, "estado" varchar not null default ('Activo'), "created_at" datetime, "updated_at" datetime, "operador_id" integer, foreign key("operador_id") references "operadors"("id") on delete set null);
CREATE TABLE IF NOT EXISTS "contenedors" ("id" integer primary key autoincrement not null, "numero_contenedor" varchar not null, "estado_contenedor" varchar not null, "estado" varchar not null default ('Activo'), "created_at" datetime, "updated_at" datetime, "tipo_contenedor_id" integer, "tamano_contenedor" varchar not null default ('20'), "tara_contenedor" integer, "anofab_contenedor" integer, "pais_id" integer, "ingreso_doc" varchar, "comentario" text, "fecha_ingreso" date, "tatc" varchar, "lugardeposito_id" integer, "aduana_ingreso_id" integer, "operador_id" integer, "rut_factura" varchar, "nombre_factura" varchar, "direccion_factura" varchar, "giro_factura" varchar, "fecha_factura" date, "orden_compra" varchar, "tipo_pago" varchar, "valor_factura" integer, "reserva_nombre" varchar, "comentario_facturacion" text, "empresa_transportista_id" integer, "rut_chofer" varchar, "patente_camion" varchar, "documento_transporte" varchar, "origen_tatc" varchar, "destino_tatc" varchar, "tatc_emisor" varchar, "tatc_ingreso" varchar, "tipo_ingreso" varchar check ("tipo_ingreso" in ('1', '2')), "eir" varchar, "comentario_tatc" text, "extra_proveedor_nombre" varchar, "extra_proveedor_factura" varchar, "extra_proveedor_valor" varchar, "extra_proveedor_fecha" date, "extra_panama_factura" varchar, "extra_panama_valor" varchar, "extra_panama_fecha" date, "extra_cym_factura" varchar, "extra_cym_valor" varchar, "extra_cym_fecha" date, "extra_boxtam_factura" varchar, "extra_boxtam_fecha" date, "extra_ciudad" varchar, "extra_tipo" varchar, "factura_oc" varchar, "factura_comentario" text, "transporte_documento" varchar, foreign key("tipo_contenedor_id") references "tipo_contenedors"("id") on delete set null, foreign key("lugardeposito_id") references "lugar_depositos"("id") on delete set null, foreign key("empresa_transportista_id") references "empresa_transportistas"("id") on delete set null, foreign key("aduana_ingreso_id") references "aduana_chiles"("id") on delete set null, foreign key("operador_id") references "operadors"("id") on delete set null);
CREATE TABLE IF NOT EXISTS "tatcs" ("id" integer primary key autoincrement not null, "numero_tatc" varchar not null, "numero_contenedor" varchar not null, "tipo_contenedor" varchar not null, "tara_contenedor" varchar, "estado" varchar not null default ('Pendiente'), "hermes_request" text, "hermes_response" text, "hermes_status" varchar, "hermes_message_id" varchar, "hermes_sent_at" datetime, "hermes_processed_at" datetime, "user_id" integer not null, "created_at" datetime, "updated_at" datetime, "tipo_ingreso" varchar not null, "ingreso_pais" datetime not null, "ingreso_deposito" datetime not null, "tatc_origen" varchar, "tatc_destino" varchar, "documento_ingreso" varchar, "fecha_traspaso" date not null, "tipo_bulto" varchar, "valor_fob" numeric, "comentario" text, "aduana_ingreso" varchar not null, "eir" varchar, "tamano_contenedor" varchar check ("tamano_contenedor" in ('20', '40', '45')) not null, "puerto_ingreso" varchar not null, "estado_contenedor" varchar check ("estado_contenedor" in ('OP', 'DM')) not null, "anio_fabricacion" varchar, "ubicacion_fisica" varchar not null, "valor_cif" numeric, "empresa_transportista_id" integer, "rut_chofer" varchar, "patente_camion" varchar, "documento_transporte" varchar, foreign key("user_id") references users("id") on delete cascade on update no action, foreign key("empresa_transportista_id") references "empresa_transportistas"("id"));
CREATE TABLE IF NOT EXISTS "tatc_historials" ("id" integer primary key autoincrement not null, "tatc_id" integer not null, "user_id" integer not null, "accion" varchar not null, "detalles" text, "datos_anteriores" text, "datos_nuevos" text, "estado_anterior" varchar, "estado_nuevo" varchar, "created_at" datetime, "updated_at" datetime, foreign key("tatc_id") references "tatcs"("id") on delete cascade, foreign key("user_id") references "users"("id"));
CREATE TABLE IF NOT EXISTS "tstc_historials" ("id" integer primary key autoincrement not null, "tstc_id" integer not null, "user_id" integer not null, "accion" varchar not null, "detalles" text not null, "datos_anteriores" text, "datos_nuevos" text, "estado_anterior" varchar, "estado_nuevo" varchar, "created_at" datetime, "updated_at" datetime, foreign key("tstc_id") references "tstcs"("id") on delete cascade, foreign key("user_id") references "users"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "salidas" ("id" integer primary key autoincrement not null, "tatc_id" integer not null, "numero_salida" varchar not null, "fecha_salida" date not null, "tipo_salida" varchar not null, "motivo_salida" varchar, "numero_contenedor" varchar not null, "tipo_contenedor" varchar not null, "estado_contenedor" varchar, "aduana_salida" varchar not null, "documento_aduana" varchar, "numero_documento" varchar, "empresa_transportista_id" integer, "rut_chofer" varchar, "patente_camion" varchar, "destino_final" varchar, "pais_destino" varchar, "observaciones" text, "estado" varchar check ("estado" in ('Pendiente', 'Aprobado', 'Rechazado', 'Cancelado')) not null default 'Pendiente', "user_id" integer not null, "created_at" datetime, "updated_at" datetime, foreign key("tatc_id") references "tatcs"("id") on delete cascade, foreign key("empresa_transportista_id") references "empresa_transportistas"("id") on delete set null, foreign key("user_id") references "users"("id") on delete cascade);
CREATE TABLE IF NOT EXISTS "tstcs" ("id" integer primary key autoincrement not null, "numero_tstc" varchar not null, "numero_contenedor" varchar not null, "tipo_contenedor" varchar not null, "tara_contenedor" varchar, "estado" varchar not null default ('Pendiente'), "observaciones" text, "user_id" integer not null, "created_at" datetime, "updated_at" datetime, "operador_id" integer not null, "fecha_emision_tstc" date not null, "destino_contenedor" varchar, "valor_fob" numeric, "comentario" text, "ingreso_deposito" date not null, "aduana_salida" varchar not null, "fecha_salida_pais" datetime not null, "tamano_contenedor" varchar not null, "estado_contenedor" varchar not null, "codigo_tipo_bulto" varchar not null, "anio_fabricacion" varchar, "empresa_transportista_id" integer, "rut_chofer" varchar, "patente_camion" varchar, "documento_transporte" varchar);
DELETE FROM sqlite_sequence;
CREATE INDEX "jobs_queue_index" on "jobs" ("queue");
CREATE UNIQUE INDEX "failed_jobs_uuid_unique" on "failed_jobs" ("uuid");
CREATE INDEX "personal_access_tokens_tokenable_type_tokenable_id_index" on "personal_access_tokens" ("tokenable_type", "tokenable_id");
CREATE UNIQUE INDEX "personal_access_tokens_token_unique" on "personal_access_tokens" ("token");
CREATE INDEX "sessions_user_id_index" on "sessions" ("user_id");
CREATE INDEX "sessions_last_activity_index" on "sessions" ("last_activity");
CREATE UNIQUE INDEX "companies_rut_unique" on "companies" ("rut");
CREATE UNIQUE INDEX "customs_declarations_declaration_number_unique" on "customs_declarations" ("declaration_number");
CREATE UNIQUE INDEX "permissions_name_guard_name_unique" on "permissions" ("name", "guard_name");
CREATE UNIQUE INDEX "roles_name_guard_name_unique" on "roles" ("name", "guard_name");
CREATE INDEX "model_has_permissions_model_id_model_type_index" on "model_has_permissions" ("model_id", "model_type");
CREATE INDEX "model_has_roles_model_id_model_type_index" on "model_has_roles" ("model_id", "model_type");
CREATE UNIQUE INDEX "operadors_codigo_unique" on "operadors" ("codigo");
CREATE UNIQUE INDEX "empresa_transportistas_rut_empresa_unique" on "empresa_transportistas" ("rut_empresa");
CREATE UNIQUE INDEX "aduana_chiles_codigo_unique" on "aduana_chiles" ("codigo");
CREATE UNIQUE INDEX "lugar_depositos_codigo_unique" on "lugar_depositos" ("codigo");
CREATE UNIQUE INDEX "users_email_unique" on "users" ("email");
CREATE UNIQUE INDEX "tipo_contenedors_codigo_unique" on "tipo_contenedors" ("codigo");
CREATE UNIQUE INDEX "contenedors_numero_contenedor_unique" on "contenedors" ("numero_contenedor");
CREATE UNIQUE INDEX "tatcs_numero_tatc_unique" on "tatcs" ("numero_tatc");
CREATE INDEX "tstc_historials_tstc_id_index" on "tstc_historials" ("tstc_id");
CREATE INDEX "tstc_historials_user_id_index" on "tstc_historials" ("user_id");
CREATE INDEX "tstc_historials_accion_index" on "tstc_historials" ("accion");
CREATE INDEX "salidas_numero_salida_index" on "salidas" ("numero_salida");
CREATE INDEX "salidas_fecha_salida_index" on "salidas" ("fecha_salida");
CREATE INDEX "salidas_tipo_salida_index" on "salidas" ("tipo_salida");
CREATE INDEX "salidas_estado_index" on "salidas" ("estado");
CREATE UNIQUE INDEX "salidas_numero_salida_unique" on "salidas" ("numero_salida");
CREATE UNIQUE INDEX "tstcs_numero_tstc_unique" on "tstcs" ("numero_tstc");
COMMIT;
